//            <Route path="user" element={<CreateUser />} /> 

//          </Routes>
//  </Router>



//   )
const handleChange = (event) => {
    setSession(event.target.value);
    console.log(session);
  };

  const newSession = () => {
    var validname= false;
    axios
    .post("http://localhost:5000/songs/add", {
      username: name,
      sessionName:session
    })
    .then(res => {
      var id=res.data;

        validname=true;
        setSessionID(id);
      console.log(id);

    })
    .catch(() => {
        console.log("bad sessionname catch");

    })

  };


// useEffect(()=>{
//     if (session=="") return
//     if (sessionID=="") return
//     if (!accessToken) return
//     console.log(sessionID);



// },[sessionID])
var interval;
useEffect(() => {
    if (session=="") return
    if (sessionID=="") return
    if (!accessToken) return
     interval = setInterval(() => {
     fetchSong();
    }, 1000);
    return () => clearInterval(interval);
  }, [sessionID]);

  const stopSession=()=>{
    clearInterval(interval);

  }


  const fetchSong=()=>{

    spotifyApi.getMyCurrentPlayingTrack()
    .then(function(data){ 
        if(data.body.is_playing!=false){
            console.log(lastSong);
            if(lastSong!=data.body.item.name){
               lastSong =data.body.item.name;
                console.log(data.body.item);
         //   console.log(data.body.item.artists[0].name);
            axios
            .post("http://localhost:5000/songs/updateSong", {
              sessionID: sessionID,
              songTitle: data.body.item.name,

            })
            .then(res => {
              console.log("update w song");
            })
            .catch(() => {
                console.log("bad update catch");
            }) 

            axios.post("http://localhost:5000/songs/updateArtist", {
              sessionID: sessionID,

              songArtist: data.body.item.artists[0].name
            })
            .then(res => {
              console.log("update w art");
            })
            .catch(() => {
                console.log("bad update catch");

            }) 



            //THIS IS TEST MAP



            // update the state

            key=key+1;
            console.log(listOfSongs);
            //difftest


                // var newMap = data.body.item.map(item => {
                //   const smallestAlbumImage = item.album.images.reduce(
                //     (smallest, image) => {
                //       if (image.height < smallest.height) return image
                //       return smallest
                //     },
                //     item.album.images[0]
                //   )

                //   return {
                //     artist: item.artists[0],
                //     title: item.name,
                //     uri: item.uri,
                //     albumUrl: smallestAlbumImage.url,
                //   }
                // })



                console.log(listOfSongs);

            //END TEST MAP

        }
        }
    } )
    .catch((err) => {
    console.log(err);
    })
}

useEffect(() => {
    console.log(listOfSongs);

  }, [listOfSongs]);







return (
    <Container className="d-flex flex-column py-2" style={{ height: "100vh" }}>
    <input
        type="text"
        id="message"
        name="message"
        onChange={handleChange}
        value={session}
      />

    <button onClick={newSession}>Start Sesstion</button>
    <button onClick={stopSession}>Stop Sesstion</button>
   <div className="flex-grow-1 my-2" style={{ overflowY: "auto" }}>
        Songs
    </div>
  </Container>
  )

}
